    def sum_of_odd_divisors(n: int) -> int:
        """Helper function to calculate the sum of all odd divisors of a given number n."""
        total = 0
        for j in range(1, n + 1, 2):
            total += j * (n // j)
        return total
    result = 0
    for num in range(l, r + 1):
        result += sum_of_odd_divisors(num)
    return result
